def calc_aggregate(num):

    def is_prime(n):
        if n < 1:
            return False
        if n <= 3:
            return True
        if n % 2 == 0 or n % 3 == 0:
            return False
        i = 5
        while i * i <= n:
            if n % i == 0 or n % (i + 2) == 0:
                return False
            i += 6
        return True

    def is_fibonacci(n):
        x = 0
        y = 1
        while y < n:
            z = x + y
            x = y
            y = z
        return y == n
    primes = []
    fib_primes = []
    for i in range(2, num):
        if is_prime(i):
            primes.append(i)
            if is_fibonacci(i):
                fib_primes.append(i)
    prime_sum = sum(primes)
    fib_prime_sum = sum(fib_primes)
    return (prime_sum, fib_prime_sum)

